import React from "react";
import { Routes, Route, Switch, Link } from "react-router-dom";
import Navigation from "./Navigation";

function App() {
  return (
    <React.Fragment>
      <Navigation />

      <Routes>
        <Route exact path="/"></Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
